import React from "react";

function Note(props) {
  function handleClick(item) {
    console.log(item)
   if(item.completed===false){
     item.completed = true;
 
  }
else
   {
         item.completed = false;

     }
  }
 function handleDelete(id) {
  props.onDelete(id);
  }
  if(props.note.leangth>1){
  return (
    <div className="note">
          {  props.note.map((item,index) => {
      return <ul> <li onClick={() => {handleClick(item)}} key={item.id}>{item.title}</li></ul>
      })}
 <button onClick={() => {handleDelete(props.id)}}>DELETE</button>

      
    </div>
  );
}
}

export default Note;
